import React from 'react'
import { Link } from 'react-router-dom'



export default function Menu() {
  return (
    <div>
        
      <Link to='/Profil'>Profil</Link>
      <Link to='/App1'>Calculatrice</Link>
      <Link to='/App2'>Slider</Link>
      <Link to='/App3'>TodoList</Link>
      <Link to='/App4'>API</Link>
    </div>
  )
}
